import classes from "./Header.module.css";
import NavBar from "./NavBar";
import { useSelector } from "react-redux";


const Header = () => {
  return (
    <div className={classes.header}>
      <h1>Meetup</h1>
      <NavBar></NavBar>
      {<button className={classes.btn_round}>
        Buy Tickets
      </button>}
    </div>
  );
};
export default Header;
